import React from 'react';
import FormSearchBug from '../FormSearchBug/FormSearchBug';
import NavMain from '../NavMain/NavMain';

const HomePage = ({handleSubmit, handleInputChange, inputValue, setInputValue}) => {
    return ( <>
        <NavMain/>
        <FormSearchBug inputValue={inputValue} handleSubmit={handleSubmit} handleInputChange={handleInputChange} setInputValue={setInputValue}/>

    </> );
}

export default HomePage;
